import React from 'react';
import './LastMeasureResult.css';
import { connect } from 'react-redux';
import moment from 'moment';


const LastMeasureResult = (measurement) => {
    return(
        <div className="last-measure-result">
            <p>Your last measure:</p>
            <h1>{measure.systolic}/{measure.diastolic}</h1>
            <h1>Pulse - {measure.pulse}</h1>
            <p>data</p>
        </div>
    );
}

const mapStateToProps = (state) => {
    console.log(state);
    return {
        measurement: state.firestore.ordered.measurement
    }
}

export default connect(null, mapStateToProps)(LastMeasureResult)
